oxy_webhelp_navlinks = {"azr_exocompute-d22872e16025":{"topics":[{"title":"Introduction to Exocompute on Azure","href":"saas\/azr_pvt_aks_clusters.html","menu":{"hasChildren":false},"tocID":"tocId-d22872e16042","next":"tocId-d22872e16042"},{"title":"Evaluate Exocompute on Azure options","shortdesc":"<p class=\"shortdesc\">When setting up Exocompute on Azure, it is important to evaluate the options for         deployment and networking. Thorough evaluation of these choices helps to align them with the         needs of your organization prior to Exocompute configuration.<\/p>","href":"saas\/azr_exocompute_evaluate_choices.html","attributes":{"data-id":"azr_exocompute_evaluate_choices"},"menu":{"hasChildren":false},"tocID":"azr_exocompute_evaluate_choices-d22872e16076","next":"azr_exocompute_evaluate_choices-d22872e16076"},{"title":"Set up network for Exocompute on Azure","shortdesc":"<p class=\"shortdesc\">To ensure proper functioning of the Exocompute on Azure feature that uses the Azure         Kubernetes Service (AKS) cluster, it is essential to meet specific network prerequisites for         seamless communication among <span class=\"ph\">RSC<\/span>, the AKS cluster, and Azure         services.<\/p>","href":"saas\/azr_exocompute_network_setup.html","attributes":{"data-id":"azr_exocompute_network_setup"},"menu":{"hasChildren":false},"tocID":"azr_exocompute_network_setup-d22872e16134","next":"azr_exocompute_network_setup-d22872e16134"},{"title":"Configure Exocompute on Azure","shortdesc":"<p class=\"shortdesc\">The configuration workflow sequence for localized and centralized Exocompute,         Rubrik-hosted ACR, and Rubrik-managed AKS cluster.<\/p>","href":"saas\/azr_configuration_exocompute.html","attributes":{"data-id":"azr_configuration_exocompute"},"menu":{"hasChildren":false},"tocID":"azr_configuration_exocompute-d22872e16360","next":"azr_configuration_exocompute-d22872e16360"},{"title":"Private Container Registry for Azure","shortdesc":"<p class=\"shortdesc\">For security purposes, when you do not want to retrieve Docker images from a registry         hosted by Rubrik or when you want to scan the Docker images for CVEs, you can configure a         Private Container Registry to retrieve these Docker images from a registry you         host.<\/p>","href":"saas\/azr_private_container_registry.html","attributes":{"data-id":"azr_private_container_registry.dita"},"menu":{"hasChildren":false},"tocID":"azr_private_container_registry.dita-d22872e16404","next":"azr_private_container_registry.dita-d22872e16404"},{"title":"Exocompute health check for Azure","shortdesc":"<p class=\"shortdesc\">The Exocompute health check for Azure feature in <span class=\"ph\">RSC<\/span> runs a health         check for an Azure Kubernetes Service cluster immediately after its configuration and         displays the current status of the cluster. With the health check feature, you can determine         if the Azure Kubernetes Service cluster is functioning correctly.<\/p>","href":"saas\/azr_exocompute_health_check.html","attributes":{"data-id":"azr_exocompute_health_check"},"menu":{"hasChildren":false},"tocID":"azr_exocompute_health_check-d22872e16437","next":"azr_exocompute_health_check-d22872e16437"},{"title":"Advanced settings for Exocompute on Azure","shortdesc":"<p class=\"shortdesc\">For better performance, scalability, and advanced security features such as         encryption at the host where Azure encrypts data before it is written to storage disks, you         can optionally configure advanced Exocompute settings using <span class=\"ph\">RSC<\/span>.<\/p>","href":"saas\/azr_adv_exo_settings_aks_clusters.html","attributes":{"data-id":"azr_adv_exo_settings_aks_clusters"},"menu":{"hasChildren":false},"tocID":"azr_adv_exo_settings_aks_clusters-d22872e16473","next":"azr_adv_exo_settings_aks_clusters-d22872e16473"},{"title":"Viewing Exocompute events","shortdesc":"<p class=\"shortdesc\">View the Events page from the Dashboard to see the Exocompute events.<\/p>","href":"saas\/viewing_exo_health_check_events_3.html","attributes":{"data-id":"viewing_exo_health_check_events"},"menu":{"hasChildren":false},"tocID":"viewing_exo_health_check_events-d22872e16498","next":"viewing_exo_health_check_events-d22872e16498"},{"title":"Viewing the Exocompute on Azure details page","shortdesc":"<p class=\"shortdesc\">View the details of an Exocompute on Azure instance. Based on the information, you         can run a health check, add or delete regions, or deactivate and delete an Exocompute host         subscription, if required.<\/p>","href":"saas\/azr_viewing_exocompute_details_page.html","attributes":{"data-id":"azr_viewing_exocompute_details_page"},"menu":{"hasChildren":false},"tocID":"azr_viewing_exocompute_details_page-d22872e16520","next":"azr_viewing_exocompute_details_page-d22872e16520"},{"title":"Maintain Exocompute on Azure","shortdesc":"<p class=\"shortdesc\">Maintaining Exocompute on Azure involves regularly reviewing and updating settings         and removing obsolete configurations to ensure optimal performance and resource         management.<\/p>","href":"saas\/azr_maintenance_and_cleanup.html","attributes":{"data-id":"azr_maintenance_and_cleanup"},"menu":{"hasChildren":false},"tocID":"azr_maintenance_and_cleanup-d22872e16542","next":"azr_maintenance_and_cleanup-d22872e16542"},{"title":"Resolving common Azure Exocompute issues","shortdesc":"<p class=\"shortdesc\">You can troubleshoot and resolve common Azure Exocompute issues that occurs while         setting up an Azure Kubernetes Service cluster. The AKS cluster not starting properly is a         common issue reported to Rubrik Support. Some reasons for this are described         below.<\/p>","href":"saas\/azr_resolving_common_exocompute_issues.html","attributes":{"data-id":"azr_resolving_common_exocompute_issues"},"menu":{"hasChildren":false},"tocID":"azr_resolving_common_exocompute_issues-d22872e16598","topics":[]}]}};